interface TokenBalance {
    token_address: string;
    name: string;
    symbol: string;
    balance: string;
}

interface NftBalance {
    token_address: string;
    token_id: string;
    owner_of: string;
    contract_type: string;
    name: string;
    symbol: string;
    amount: string;
}

interface ChainBalance {
    chain: string;
    nativeBalance: {
        balance: string;
    };
    tokenBalances: TokenBalance[];
    nftBalances: NftBalance[];
}

const url = 'http://localhost:3001/api/balances?address=0x35e66f648E34617966296CACD6eb3114b74b8b9e';
async function getBalances() {
    try {
        const response = await axios.get(url);
        const balances = response.data.map((chainBalance: ChainBalance) => ({
            chain: chainBalance.chain,
            balance: chainBalance.nativeBalance.balance,
        }));

        return balances;
    } catch (error) {
        console.log(error);
    }
}




